import React from 'react';
import './Home.scss';

const Home = () => {
    return (
        <section class="hero bg-image is-fullheight-with-navbar">
            <div class="hero-body">
                <div class="container">
                    <p class="title has-text-centered has-text-white">Welcome To Manager</p>
                </div>
            </div>
        </section>
    )
}

export default Home
